import { Nav } from "react-bootstrap";
import {
  CardList,
  GraphDownArrow,
  HouseFill,
  PersonFill
} from "react-bootstrap-icons";

function Sidebar({setShowWeightModal, setShowDayModal}: any) {
  return (
    <Nav className="flex-sm-column justify-content-evenly">
      <Nav.Link href="/"><HouseFill /></Nav.Link>
      <Nav.Link href="#" onClick={() => setShowWeightModal(true)}><GraphDownArrow /></Nav.Link>
      <Nav.Link href="#" onClick={() => setShowDayModal(true)}><CardList /></Nav.Link>
      <Nav.Link href="#"><PersonFill /></Nav.Link>
    </Nav>
  );
}

export default Sidebar;
